script: |
  super -f tsv -I q7197.sql | sort > q7197.out

vector: true

inputs:
  - name: q7197.sql
    data: |
      SELECT ALL - col2 / col2 + 80 AS col0 FROM tab0 AS cor0 GROUP BY col2, col1 HAVING NOT + - ( 81 ) = col1 * + - col1 * + - col2;
  - name: tab0

outputs:
  - name: q7197.out
    data: |
      79
      79
      79
